import { useEffect, useState } from "react";

function News() {
  const [Noticias, setNoticias] = useState([]);
  useEffect(() => {
    fetch(
      "http://api.mediastack.com/v1/news?access_key=7e4ec37df17151d47554a7f64556cec4&languages=es&countries=co"
    )
      .then((Response) => Response.json())
      .then((results) => setNoticias(results.results));
    console.log(Noticias.toString);
  }, []);
  return (
    <div className="news">
      {Noticias.map((item: any) => (
        <div className="box" key={item.author}>
          <img src={item.image} alt={item.category} />
          <div className="character">
            <h3 className="name">{item.title}</h3>
            <p className="especie">{item.description}</p>
            <p className="status">{item.source}</p>
          </div>
        </div>
      ))}
    </div>
  );
}

export default News;
